import React, { useContext } from "react";
import { UniversalContext } from "./App";

function ProjectDescription(props) {
  const projectContext = useContext(UniversalContext);
  const indexContext = useContext(UniversalContext);
  const data = projectContext.projects;
  console.log("pro context", projectContext.projects);
  if (projectContext.projects.feed !== undefined) {
    var title = data.feed.entry[3].gsx$title.$t;
    var image = data.feed.entry[3].gsx$image.$t;
    var description = data.feed.entry[3].gsx$description.$t;
  }
  console.log("pro context", projectContext.projectIndex);
  return (
    <div className="project-squar">
      <p>{title}</p>
      <p>
        <img alt="9" className="imageg" src={image}></img>
        {description}
      </p>
    </div>
  );
}

export default ProjectDescription;
